import styled from 'styled-components'

const Container = styled.div`
    width:100%;
    height:500px;
    background-color: aquamarine;
    display:inline-block;
    justify-content: center;
    align-items: center;
    
`
const Btn = styled.button`
    
`
export {Container,Btn}
